char prime(unsigned int number)
{
	if (number == 2)
	    return '1';
	for (int i=0; i<COUNT; i++)
	{
        if (number % seri[i][0] == 0)
            return '0';
        if (number < seri[i][1])
            return '1';
    }
    return '1';
}

int main(int argc, char** argv)
{
    clock_gettime(CLOCK_REALTIME, &before);
    char input[OUTPUT_BUFFER_SIZE];
    char output[OUTPUT_BUFFER_SIZE];
    char output2[OUTPUT_BUFFER_SIZE];
    FILE* file = fopen(argv[1], "r");
    output[0] =0;
    const char s[2] = "\n";
    char *token;
    setvbuf(stdout, output2, _IOFBF, OUTPUT_BUFFER_SIZE);
    int n, j=0, k;
    char c[3], *last_token;
    char res[3];
    res[1] = '\n';
    res[2] = '\0';
    while (1) {
        k = fread(input, 1, OUTPUT_BUFFER_SIZE, file);
        token = strtok(input, s);
        while( token != NULL ) {
            n = atoi(token);
            res[0] = prime(n);
            strcat(output, res);
            last_token = token;
            token = strtok(NULL, s);
            if (token ==  NULL)
                break;
            if (j++ == 2000) {
                j = 0;
                if (k < OUTPUT_BUFFER_SIZE)
                {
                   // output[strlen(output) - 1] = 0;
                }
                printf("%s", output);
                strcpy(output, "");
            }
        }
        if (k < OUTPUT_BUFFER_SIZE)
            break;
        output[strlen(output) - 2] = 0;
        fseek(file, -strlen(last_token), SEEK_CUR);
    }
    if (!output[0]){
        output[strlen(output) - 1] = 0;
        printf("%s", output);
    }
    fclose(file);
    fflush(stdout);
    clock_gettime(CLOCK_REALTIME, &after);
    elapsed_nsecs = (after.tv_sec - before.tv_sec) * 1000000000 + (after.tv_nsec - before.tv_nsec);
    //printf("%ld", elapsed_nsecs / 1000000);
    return EXIT_SUCCESS;
}

